import { Button } from "@mui/material";

function App() {
  return (
    <div>
      <Button variant="text">Text</Button>
      <Button variant="contained" color="secondary" size>Contained</Button>
      <Button variant="outlined">Outlined</Button>
    </div>
  );
}

export default App;
